import { Provider } from "react-redux";
import { store1 } from "./pages/Posts/actions/store";

ReactDOM.render(
  <React.StrictMode>
    <Provider store={store}>
      <App />
    </Provider>
  </React.StrictMode>,
  document.getElementById("root")
